import React from 'react';

function ExpensesTable({ expenses }) {
    console.log("ExpensesTable received:", expenses);

    // Extract actual expenses array
    const expenseList = expenses?.data || [];

    if (!Array.isArray(expenseList)) {
        console.error("Expenses is not an array:", expenseList);
        return <p>No expenses to display</p>;
    }

    return (
        <div className="expense-list">
            {expenseList.map((expense, index) => (
                <div key={index} className="expense-item">
                    <button className="delete-button"
                    onClick={handleDele}
                    
                    >X</button>
                    <div className="expense-description">{expense.text}</div>
                    <div className="expense-amount"
                    style={{color:expense.amount>0? '#27ae60':'#e74c3c'}}
                    
                    >{expense.amount}</div>
                </div>
            ))}
        </div>
    );
}


export default ExpensesTable;
